import React, { Fragment, Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import axios from "axios";
import ListItem from "./List/ListItem";

class OnlineProduct extends Component {
  state = {
    Resource : [],
}

componentDidMount() {
    axios.get('js/data.json').then( res => {this.setState({Resource : res.data.Resource})})
}

render(){

    const {Resource} = this.state;
    const ResourceList = Resource.map( (ResourceItem) => {

return(
    <Fragment key={ResourceItem.id}>

        <div>
        <ListItem ResourceItem={ResourceItem} />
            {ResourceItem.Name}
        </div>

    </Fragment>
)
})
    return(  
        <div className="Videos">
            {ResourceList}
        </div>
    );
}
}
export default OnlineProduct;
